import React from 'react';
import TodoList from './TodoList'
import PersonList from './PersonList'
import Bootstrap from './bootstrap'
import NavbaraElement from './Navbar'

import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <>
    <NavbaraElement />
    <br></br>
    <br></br>
    <br></br>
    <Bootstrap />
    <PersonList />
    <TodoList />
    </>
  )
}

export default App;
